	/** Constructs a new AudioClip with the data from qcorrect.wav. */
	public DingSound() {
		data = getData();
		format = new AudioFormat(AudioFormat.Encoding.PCM_UNSIGNED,
				(float) (44100.0), 16, 1, 2, (float) (44100.0), false);
		lineInfo = new DataLine.Info(SourceDataLine.class, format,
				AudioSystem.NOT_SPECIFIED);
		try {
			AudioSystem.getLine(lineInfo);
		} catch (IllegalArgumentException ex) {
			lineInfo = null;
		} catch (LineUnavailableException e) {
		}
	}

	/** A separate thread for playing qcorrect.wav. */
	private class PlayThread extends Thread {
		private byte[] data;
		private AudioFormat format;
		private DataLine.Info lineInfo;
		private SourceDataLine line = null;
		private boolean playing = true;

		public PlayThread(byte[] d, AudioFormat f, DataLine.Info i) {
			data = d;
			format = f;
			lineInfo = i;
		}

		public void run() {
			try {
				line = (SourceDataLine) AudioSystem.getLine(lineInfo);
				line.open(format, AudioSystem.NOT_SPECIFIED);
				line.start();
				int written = 0;
				int available;
				while (written < data.length && playing) {
					available = Math.min(line.available(), data.length
							- written);
					line.write(data, written, available);
					written += available;
				}
				int frames = data.length / format.getFrameSize();
				while (line.getFramePosition() < frames && playing)
					Thread.sleep(0);
			} catch (InterruptedException ex) {
				playing = false;
			} catch (LineUnavailableException ex) {
			}
			if (line != null) {
				line.stop();
				line.flush();
				line.close();
			}
			playing = false;
		}

		public void interrupt() {
			playing = false;
		}

		public boolean isPlaying() {
			return playing;
		}
	}

	/** A separate thread for looping play of qcorrect.wav. */
	private class LoopThread extends Thread {
		private DingSound clip;
		private boolean looping = true;

		public LoopThread(DingSound c) {
			clip = c;
		}

		public void run() {
			while (looping) {
				clip.play();
				while (clip.isPlaying() && looping) {
					try {
						Thread.sleep(0);
					} catch (InterruptedException ex) {
						looping = false;
						break;
					}
				}
			}
			if (!clip.isLooping())
				clip.stop();
		}

		public void interrupt() {
			looping = false;
		}

		public boolean isLooping() {
			return looping;
		}
	}

	/**
	 * Plays qcorrect.wav from the beginning, even if it is already playing or
	 * looping.
	 */
	public void play() {
		if (lineInfo == null)
			return;
		doPlay();
	}

	private synchronized void doPlay() {
		doStopPlay();
		playThread = new PlayThread(data, format, lineInfo);
		playThread.start();
	}

	/** Plays qcorrect.wav continuously until stopped. */
	public void loop() {
		if (lineInfo == null)
			return;
		doLoop();
	}

	private synchronized void doLoop() {
		doStopLoop();
		loopThread = new LoopThread(this);
		loopThread.start();
	}

	/** Stops play and looping of qcorrect.wav. */
	public void stop() {
		if (lineInfo == null)
			return;
		doStop();
	}

	private synchronized void doStop() {
		doStopPlay();
		doStopLoop();
	}

	private void doStopPlay() {
		if (playThread == null)
			return;
		if (playThread.isPlaying())
			playThread.interrupt();
		playThread = null;
	}

	private void doStopLoop() {
		if (loopThread == null)
			return;
		if (loopThread.isLooping())
			loopThread.interrupt();
		loopThread = null;
	}

	/**
	 * Tests if qcorrect.wav is currently playing or looping.
	 * 
	 * @return <tt>true</tt> if playing or looping, <tt>false</tt> otherwise
	 */
	public boolean isPlaying() {
		if (lineInfo == null)
			return false;
		return doIsPlaying();
	}

	private synchronized boolean doIsPlaying() {
		if (loopThread == null && playThread == null)
			return false;
		else if (loopThread == null)
			return playThread.isPlaying();
		else if (playThread == null)
			return loopThread.isLooping();
		else
			return loopThread.isLooping() && playThread.isPlaying();
	}

	/**
	 * Tests if qcorrect.wav is currently looping.
	 * 
	 * @return <tt>true</tt> if looping, <tt>false</tt> otherwise
	 */
	public boolean isLooping() {
		if (lineInfo == null)
			return false;
		return doIsLooping();
	}

	private synchronized boolean doIsLooping() {
		if (loopThread == null)
			return false;
		else
			return loopThread.isLooping();
	}
